/****** SYSTEM REQUIREMENTS *****/
/****** SYSTEM REQUIREMENT 1 *****/
	/* blynk code */
/****** END SYSTEM REQUIREMENTS *****/

/* START CODE */

/****** DEFINITION OF LIBRARIES *****/
#include <Blynk.h>	//https://github.com/blynkkk/blynk-library

/****** FUNCTION PROTOTYPES *****/
void setup(void);
void loop(void);
void updateOutputs();
void sendDataToBlynk(); // Function to send data to Blynk

/***** DEFINITION OF DIGITAL OUTPUT PINS *****/
const uint8_t myLED_LED_PIN_D2		= 2;

/***** DEFINITION OF OUTPUT RAW VARIABLES *****/
/***** used to store raw data *****/
bool	myLED_LED_PIN_D2_rawData		= 0;

/***** DEFINITION OF OUTPUT PHYSICAL VARIABLES *****/
/***** used to store data after characteristic curve transformation *****/
float	myLED_LED_PIN_D2_phyData		= 0.0;

/****** BLYNK AUTH TOKEN *****/
char auth[] = "YourBlynkAuthToken"; // Replace with your Blynk Auth Token

/****** DEFINITION OF LIBRARIES CLASS INSTANCES*****/

void setup(void)
{
	// put your setup code here, to run once:
	Blynk.begin(auth); // Initialize Blynk with Auth Token
	pinMode(myLED_LED_PIN_D2, OUTPUT);
}

void loop(void)
{
	// put your main code here, to run repeatedly:
	Blynk.run(); // Run Blynk
	updateOutputs(); // Refresh output data
	sendDataToBlynk(); // Send data to Blynk
}

void updateOutputs()
{
	digitalWrite(myLED_LED_PIN_D2, myLED_LED_PIN_D2_rawData);
}

void sendDataToBlynk()
{
	Blynk.virtualWrite(V0, myLED_LED_PIN_D2_phyData); // Send physical data to virtual pin V0
}

/* END CODE */
